    public dynamic class func drawFrostHole9(frame targetFrame: CGRect = CGRect(x: 0, y: 0, width: 400, height: 700), resizing: ResizingBehavior = .aspectFit) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()!
        
        //// Resize to Target Frame
        context.saveGState()
        let resizedFrame: CGRect = resizing.apply(rect: CGRect(x: 0, y: 0, width: 400, height: 700), target: targetFrame)
        context.translateBy(x: resizedFrame.minX, y: resizedFrame.minY)
        context.scaleBy(x: resizedFrame.width / 400, y: resizedFrame.height / 700)
        let resizedShadowScale: CGFloat = min(resizedFrame.width / 400, resizedFrame.height / 700)


        //// Color Declarations
        let darkBlue = UIColor(red: 0.078, green: 0.451, blue: 0.502, alpha: 1.000)
        let gradientColor = UIColor(red: 0.157, green: 0.902, blue: 1.000, alpha: 1.000)
        let gradientColor2 = UIColor(red: 0.073, green: 0.548, blue: 0.611, alpha: 1.000)

        //// Gradient Declarations
        let gradient = CGGradient(colorsSpace: nil, colors: [gradientColor.cgColor, gradientColor2.cgColor] as CFArray, locations: [0, 0.98])!

        //// Shadow Declarations
